import React from "react";
import { useState, useEffect } from "react";
import { optionsLive } from "../options";

const Livegames = () => {
  const [data, setData] = useState([]);

  const fetchApi = async () => {
    const response = await fetch(
      "https://footapi7.p.rapidapi.com/api/matches/live",
      optionsLive
    );
    const json = await response.json();
    setData(json);
    console.log(data);
  };

  useEffect(() => {
    const options = {
      method: "GET",
      headers: {
        "X-RapidAPI-Key": "b529891cd2mshe7bca90aba3fe87p1dabf4jsnaea3d94ce638",
        "X-RapidAPI-Host": "footapi7.p.rapidapi.com",
      },
    };

    fetch("https://footapi7.p.rapidapi.com/api/matches/live", options)
      .then((response) => response.json())
      .then((response) => console.log(response))
      .catch((err) => console.error(err));
  });

  return (
    <div className="w-[calc(100%-250px)] h-full bg-black absolute top-0 left-[250px] flex-col  items-center">
      {" "}
    </div>
  );
};

export default Livegames;
